import React, { Component } from "react";

class TeamScore extends Component {
  render() {
    return (
      <div class="team-score">
        <h1>{this.props.count}</h1>
        <h2>{this.props.name}</h2>
        <h3>{this.props.earned}</h3>
        <h4>earned</h4>
      </div>
    );
  }
}

export default TeamScore;
